        return (
            <div calssName="container">
            <div className="jumbotron">
      		<h1>App Name</h1>
      		<ArticleList article={{"text": "Hello world!", "title":"first article", "date":(new Date()).toDateString()}} />
  		</div>
  		</div>
        )
    }
};

export default App;
